import React from "react";
import { useParams } from "react-router-dom";
import { useQuery, gql } from "@apollo/client";

function User() {
  const params = useParams();
  const id = params.id;
  const GET_USER_BYID = gql`
      query User($userId: ID!){
  user(id: ${params.id}) {
    name
  }
}`;
  return <div>User {params.id}</div>;
}

export default User;
